import React from "react";
import "./TabMyCourses.css";

export default function TabMyCourses() {
  return (
    <div className="tab-courses">
      <h5>
        Courses <sub>(12)</sub>
      </h5>
      <div className="search position-relative">
        <input
          placeholder="Search User"
          className=" py-2 ps-2 pe-5 rounded-2 mt-3"
          type="text"
        />
        <i class="searchIcon fs-4 fa-solid fa-magnifying-glass position-absolute"></i>
        <span></span>
        <select>
          <option>Relevance</option>
        </select>
      </div>
    </div>
  );
}
